import { FaShoppingCart } from "react-icons/fa";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
        <NavLink to="/">
          <div>
          <img src="https://rb.gy/bxfguk"/>
          </div>
        
        </NavLink>
        <div>
          <NavLink>
          <p>Home</p>
          <FaShoppingCart />

          </NavLink>
        </div>
      </div>
    </div>
  )
};

export default Navbar;
